import React, { useState, useEffect } from 'react';
import './Profile.css';
import VerticalNav from '../components/VerticalNav/VerticalNav';
import ActivityChart from '../components/charts/ActivityChart/ActivityChart';
import AverageSessionsChart from '../components/charts/AverageSessionsChart/AverageSessionsChart';
import NutritionalInfo from '../components/charts/NutritionalInfo/NutritionalInfo';
import RadarChart from '../components/charts/PerformanceChart/RadarChart';
import ScoreChart from '../components/charts/ScoreChart/ScoreChart';
import mockData from '../mockData.json';
import {
  fetchUserData,
  fetchUserActivity,
  fetchUserAverageSessions,
  fetchUserPerformance,
  mapUserData,
  mapUserActivity,
  mapUserAverageSessions,
  mapUserPerformance
} from '../service/api';

const Profile = () => {
  const [userId, setUserId] = useState('18');
  const [userData, setUserData] = useState(null);
  const [userActivity, setUserActivity] = useState(null);
  const [userAverageSessions, setUserAverageSessions] = useState(null);
  const [userPerformance, setUserPerformance] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);

        const userDataResponse = await fetchUserData(userId);
        const userActivityResponse = await fetchUserActivity(userId);
        const userAverageSessionsResponse = await fetchUserAverageSessions(userId);
        const userPerformanceResponse = await fetchUserPerformance(userId);

        const userData = await userDataResponse.json().catch(() => {
          console.warn('Using mocked user data due to fetch error.');
          const userDataFromMock = mockData.USER_MAIN_DATA.find(user => user.id === parseInt(userId));
          return mapUserData(userDataFromMock);
        });

        const userActivity = await userActivityResponse.json().catch(() => {
          console.warn('Using mocked user activity data due to fetch error.');
          const userActivityFromMock = mockData.USER_ACTIVITY.find(activity => activity.userId === parseInt(userId));
          return mapUserActivity(userActivityFromMock);
        });

        const userAverageSessions = await userAverageSessionsResponse.json().catch(() => {
          console.warn('Using mocked user average sessions data due to fetch error.');
          const userAverageSessionsFromMock = mockData.USER_AVERAGE_SESSIONS.find(session => session.userId === parseInt(userId));
          return mapUserAverageSessions(userAverageSessionsFromMock);
        });

        const userPerformance = await userPerformanceResponse.json().catch(() => {
          console.warn('Using mocked user performance data due to fetch error.');
          const userPerformanceFromMock = mockData.USER_PERFORMANCE.find(performance => performance.userId === parseInt(userId));
          return mapUserPerformance(userPerformanceFromMock);
        });

        setUserData(mapUserData(userData));
        setUserActivity(mapUserActivity(userActivity));
        setUserAverageSessions(mapUserAverageSessions(userAverageSessions));
        setUserPerformance(mapUserPerformance(userPerformance));

        setLoading(false);
      } catch (error) {
        console.error('Error fetching data:', error);
        setLoading(false);
      }
    };

    fetchData();
  }, [userId]);

  const handleUserChange = (newUserId) => {
    setUserId(newUserId);
  };

  if (loading || !userData || !userActivity || !userAverageSessions || !userPerformance) {
    return <div>Chargement...</div>;
  }

  if (!userActivity.sessions || !userAverageSessions.sessions || !userPerformance.data) {
    return <div>Donn√©es non disponibles</div>;
  }

  const { firstName } = userData.userInfos;

  return (
    <div className="profile-container">
      <VerticalNav userId={userId} onUserChange={handleUserChange} />

      <div className="profile-header-section">
        <div className="profile-header">
          <h1>Bonjour <span className="user-name">{firstName}</span></h1>
          <p>F√©licitation ! Vous avez explos√© vos objectifs hier üëè</p>
        </div>

        <div className="section-activity">
          <ActivityChart data={userActivity.sessions} />
        </div>

        <div className="trois-sections">
          <div className="section">
            <AverageSessionsChart data={userAverageSessions.sessions} />
          </div>

          <div className="section">
            <RadarChart data={userPerformance.data} />
          </div>

          <div className="section">
            <ScoreChart data={{ score: userData.score || userData.TodayScore }} />
          </div>
        </div>
      </div>

      <div className="sections">
        <NutritionalInfo
          calorieCount={userData.keyData.calorieCount}
          proteinCount={userData.keyData.proteinCount}
          carbohydrateCount={userData.keyData.carbohydrateCount}
          lipidCount={userData.keyData.lipidCount}
        />
      </div>
    </div>
  );
};

export default Profile;
